import React from 'react';
import {
  ImFacebook,
  ImTwitter,
  ImPinterest,
  ImInstagram,
  ImYoutube,
} from 'react-icons/im';

const Contact = () => {
  return (
    <section className='section bg-gray-100'>
      <div className='container mx-auto px-4 py-16'>
        <div className='flex flex-col items-center gap-y-12'>
          <h1 className=''>Contact Me</h1>
          <p className='text-lg text-center'>
            If you have any questions or need assistance with your photography, 
            please don't hesitate to reach out. I'm here to help!
          </p>
          <div className='flex gap-x-8'>
            {socialLinks.map(({ icon, href, label }) => (
              <a
                key={label}
                href={href}
                target='_blank'
                rel='noopener noreferrer'
                aria-label={`Visit my ${label}`}
                className='text-2xl transition-transform transform hover:scale-110'
              >
                {icon}
              </a>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

const socialLinks = [
  { icon: <ImFacebook />, href: 'https://www.facebook.com/', label: 'Facebook' },
  { icon: <ImTwitter />, href: 'https://twitter.com/', label: 'Twitter' },
  { icon: <ImPinterest />, href: 'https://www.pinterest.com/', label: 'Pinterest' },
  { icon: <ImInstagram />, href: 'https://www.instagram.com/', label: 'Instagram' },
  { icon: <ImYoutube />, href: 'https://www.youtube.com/', label: 'YouTube' },
];

export default Contact;
